import '../style.css';

const InputField = ({
  label,
  type,
  inputName,
  value,
  onChange,
  required,
  disabled,
}) => (
  <div className="form-field">
    {label && <label htmlFor={label}>{label}</label>}
    <input
      type={type}
      id={label}
      name={inputName}
      value={value}
      onChange={onChange}
      required={required}
      disabled={disabled}
    />
  </div>
);

export default InputField;
